import { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";
import "./styles.css"

function Navbar() {
	const navRef = useRef();

	const showNavbar = () => {
		navRef.current.classList.toggle(
			"responsive_nav"
		);
	};

	return (
		<header>
		
			<nav ref={navRef}>
				<a  className="otherel" href="/#">Home</a>
				<a href="/#">My work</a>
				
				<a href="/#">About me</a>
        <h3>LOGO</h3>
        <a href="/#">Home</a>
				<a href="/#">My work</a>
				
				<a href="/#">About me</a>
				<button
					className="nav-btn nav-close-btn"
					onClick={showNavbar}>
					<FaTimes />
				</button>
			</nav>
			<button
				className="nav-btn"
				onClick={showNavbar}>
				<FaBars />
			</button>
		</header>
	);
}

export default Navbar;
